import React from "react";

// components
import CardPageVisits from "components/Cards/CardPageVisits.js";
import Header from "components/Headers/Header.js";
import { useHistory } from "react-router";

export default function Project() {
    let history = useHistory();

    const handleExistingProject = () => {
        history.push('/admin/project-select');
    }

    const handleNewProject = () => {
        history.push('/admin/project-new');
    }

    return (
        <>
            <Header />
            <div className="px-4 md:px-10 mx-auto w-full -m-24">
                <div className="flex flex-wrap justify-center">
                    <div className="w-full xl:w-8/12 mb-12 xl:mb-0 px-4">
                        <div className="relative flex flex-col min-w-0 break-words bg-white w-full mb-6 shadow-lg rounded">
                            <div className="rounded-t mb-0 px-4 py-3 border-0">
                                <div className="flex flex-wrap items-center">
                                    <div className="relative w-full px-4 max-w-full flex-grow flex-1 text-center">
                                        <h3 className="font-semibold text-base text-blueGray-700">
                                            To begin, create a new project or select an existing one
                                        </h3>
                                    </div>
                                </div>
                            </div>
                            <div className="block w-full overflow-x-auto">
                                <div className="bg-blueGray-50 p-5 flex justify-center">
                                    <div>
                                        <div className="pb-6">
                                            <button 
                                                className="w-full bg-lightBlue-500 text-white active:bg-lightBlue-600 font-bold uppercase text-sm px-6 py-2 rounded-full shadow hover:shadow-md outline-none focus:outline-none mr-1 mb-1 ease-linear transition-all duration-150"
                                                type="button"
                                                onClick={(e) => handleNewProject()}
                                            >
                                                New Project
                                            </button>
                                        </div>
                                        <div className="pb-4">
                                            <button
                                                className="w-full bg-lightBlue-500 text-white active:bg-lightBlue-600 font-bold uppercase text-sm px-6 py-2 rounded-full shadow hover:shadow-md outline-none focus:outline-none mr-1 mb-1 ease-linear transition-all duration-150"
                                                type="button"
                                                onClick={(e) => handleExistingProject()}
                                            >
                                                Existing Project
                                            </button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
